import React from 'react';
import WorkCard from './WorkCard';

const Work = () => {
    return (
        <div>
            <div className="flex grid grid-cols-3 w-full">
                <WorkCard
                    height = '200px'
                />
                <WorkCard
                    height = '400px'
                />
                <WorkCard
                    height = '300px'
                />
                <WorkCard
                    height = '200px'
                />
                <WorkCard
                    height = '600px'
                />
            </div>
            <div className="flex gap-4">
                {[
                    [24, 32, 32, 16, 16],
                    [32, 40, 56],
                    [64, 32, 32],
                ].map((card, index) => (
                    <div className="flex-1" key={index}>
                    {card.map((height, index) => (
                        <div
                        className={`mb-4 h-${height} rounded-xl border-2 border-slate-400/10 bg-neutral-100 p-4 dark:bg-neutral-900`}
                        key={index}
                        ></div>
                    ))}
                    </div>
                ))}
                </div>
        </div>

    );
}

export default Work;
